entry.value:
import groovy.json.JsonBuilder
import java.nio.charset.StandardCharsets
import org.apache.commons.io.IOUtils

def flowFile = session.get()

def json_string = ''

session.read(flowFile, {inputStream -> json_string = IOUtils.toString(inputStream, StandardCharsets.UTF_8)} as InputStreamCallback)

def code_base = flowFile.getAttribute('code_base')

code_base = code_base . replaceAll( "\n",  ";")

def json = new JsonBuilder()

def root = json {
 "code" code_base
}

def jsonString = json.toString()


flowFile = session.write(flowFile, {outputStream -> outputStream.write(jsonString.getBytes(StandardCharsets.UTF_8))} as OutputStreamCallback)


session.transfer(flowFile, REL_SUCCESS)

